import React, { useEffect, useState } from 'react';
import { useAuth } from '../context/AuthContext';
import axios from 'axios';
import ProjectCard from '../components/ProjectCard';

export default function ProfilePage() {
  const { user, logout, isAuthenticated } = useAuth(); // Use 'user' instead of 'account'
  const [githubProfile, setGithubProfile] = useState(null);
  const [starredProjects, setStarredProjects] = useState([]);
  const [loadingProfile, setLoadingProfile] = useState(false);
  const [loadingStarred, setLoadingStarred] = useState(false);
  const [errorProfile, setErrorProfile] = useState('');
  const [errorStarred, setErrorStarred] = useState('');

  useEffect(() => {
    if (!isAuthenticated || !user) return;
    // Determine GitHub username from your auth user
    const username = user.preferred_username || user.login || user.username || user.nickname;
    if (!username) return;

    setLoadingProfile(true);
    axios
      .get(`https://api.github.com/users/${username}`)
      .then(res => setGithubProfile(res.data))
      .catch(() => setErrorProfile('Failed to fetch GitHub profile.'))
      .finally(() => setLoadingProfile(false));

    setLoadingStarred(true);
    axios
      .get(`https://api.github.com/users/${username}/starred`)
      .then(res => setStarredProjects(Array.isArray(res.data) ? res.data : []))
      .catch(() => setErrorStarred('Failed to fetch starred projects.'))
      .finally(() => setLoadingStarred(false));
  }, [isAuthenticated, user]);

  if (!isAuthenticated) {
    return (
      <div style={{ padding: '2rem', textAlign: 'center' }}>
        <h2>Please log in to view your profile.</h2>
      </div>
    );
  }

  return (
    <div style={{ padding: '2rem' }}>
      <h1>Your Profile</h1>

      {loadingProfile && <p>Loading profile...</p>}
      {errorProfile && <p style={{ color: 'red' }}>{errorProfile}</p>}
      {githubProfile && (
        <section style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
          <img
            src={githubProfile.avatar_url}
            alt={githubProfile.login}
            style={{ width: 80, height: 80, borderRadius: '50%' }}
          />
          <div>
            <h2>{githubProfile.name || githubProfile.login}</h2>
            {githubProfile.bio && <p>{githubProfile.bio}</p>}
            {githubProfile.location && (
              <p><strong>Location:</strong> {githubProfile.location}</p>
            )}
            <p>
              <strong>Public Repos:</strong> {githubProfile.public_repos} |{' '}
              <strong>Followers:</strong> {githubProfile.followers} |{' '}
              <strong>Following:</strong> {githubProfile.following}
            </p>
            <a href={githubProfile.html_url} target="_blank" rel="noopener noreferrer">
              View on GitHub
            </a>
          </div>
        </section>
      )}

      <h2 style={{ marginTop: '2rem' }}>Your Starred Projects</h2>
      {loadingStarred && <p>Loading starred projects...</p>}
      {errorStarred && <p style={{ color: 'red' }}>{errorStarred}</p>}
      {!loadingStarred && !errorStarred && (
        starredProjects.length === 0
          ? <p>You haven't starred any projects yet on GitHub.</p>
          : starredProjects.map(proj => (
              <ProjectCard key={proj.id} project={proj} />
            ))
      )}

      <button onClick={logout} style={{ marginTop: '1.5rem' }}>
        Logout
      </button>
    </div>
  );
}
